import React from "react"
import CustomHead from "../components/CustomHead"
import NavBar from "../components/NavBar"

function IndexPage() {
     const { Component, pageProps } = this.props;
    return (
        <div>
            <CustomHead/>
            <NavBar>
                <Component {...pageProps} />
            </NavBar>
        </div>
    )
}

export default IndexPage;
